             $('#myCarousel').carousel({
                interval: 4000
            });
            
            // handles the carousel thumbnails
            $('[id^=carousel-selector-]').click( function(){
              var id_selector = $(this).attr("id");
              var id = id_selector.substr(id_selector.length -1);
              id = parseInt(id);
              $('#myCarousel').carousel(id);
              $('[id^=carousel-selector-]').removeClass('selected');
              $(this).addClass('selected');
            });
            
            // when the carousel slides, auto update
            $('#myCarousel').on('slid', function (e) {
              var id = $('.item.active').data('slide-number');
              id = parseInt(id);
              $('[id^=carousel-selector-]').removeClass('selected');
              $('[id=carousel-selector-'+id+']').addClass('selected');
            });
    
    /************************************************
    BACKGROUND
    ************************************************/
    $('.bg').each(function(){
       var $this = $(this);
       var bg = $this.data('bg');
       
       if(bg){
         $this.css('background-image', 'url("' + bg + '")');
       } 
    });
    
    $('.hover').each(function(){
       var $this = $(this);
       var bg = $this.data('bg');
       
       if(bg){
         $this.hover(function () {
            $this.css('background-image', 'url("' + bg + '")');
         },function () {
            $this.css('background-image', 'none');
         });
       } 
    });
    
    /************************************************
    PRETTYPHOTO
    ************************************************/
    $('a[data-gal]').each(function() {
        $(this).attr('rel', $(this).data('gal'));
    });
    $("a[data-rel^='prettyPhoto']").prettyPhoto({
        animationSpeed: 'slow',
        theme: 'light_square',
        slideshow: true,
        overlay_gallery: true,
        social_tools: false,
        deeplinking: false
    });
    
     /* ==============================================
    FLICKR -->
    =============================================== */  
    $('.flickr-feeds').each(function(){
        var $this = $(this); 
        var user = $this.data( 'user' );
        var limit = $this.data( 'limit' );
       
        $this.jflickrfeed({
            //Change 51035555243@N01 with your flickr id
            limit: limit,
            qstrings: {
                id: user
            },
            itemTemplate: '<li class="entry"><img src="{{image_b}}" alt="{{title}}" width="80" height="80" /><div class="magnifier colorized"><a href="{{image_b}}" data-rel="prettyPhoto"><i class="flaticon-tool-2"></i></a></div></a></li>'
        });
    });
    
    /* ==============================================
    SETTINGS PANEL  -->
    =============================================== */
    $('.btn-settings').on('click', function() {
        $(this).parent().toggleClass('active');
    });
    
    $('.switch-handle').on('click', function() {
        $(this).toggleClass('active');
        $('.wrapper').toggleClass('boxed');
        $("body").addClass('bg-wood_pattern');
    });
    
    $('.color-list div').on('click', function() {
        if ($(this).hasClass('active')) return false;
        $('link.color-scheme-link').remove();
        $(this).addClass('active').siblings().removeClass('active');
        var src = $(this).attr('data-src'),
            colorScheme = $('<link class="color-scheme-link" rel="stylesheet" />');
        colorScheme
            .attr('href', src)
            .appendTo('head');
    });
    
    $('.reset').on('click', function() {
        $(".bg-list div").removeClass('active');
        $(".switch-handle").removeClass('active');
        $(".color-list div").removeClass('active');
        $(".wrapper").removeClass('boxed');
        if ($(this).hasClass('active')) return false;
        $('link.color-scheme-link').remove();
        var src = $(this).attr('data-src'),
            colorScheme = $('<link class="color-scheme-link" rel="stylesheet" />');
        colorScheme
            .attr('href', src)
            .appendTo('head');
    });
    
    $('.reset span').on('click', function() {
        $("body").removeClass("bg-shattered bg-vichy bg-random-grey-variations bg-irongrip bg-gplaypattern bg-diamond_upholstery bg-denim bg-crissXcross bg-climpek");
        $("body").addClass("bg-wood_pattern");
    });
    
